export default function Indicator() {
    return (
        <div
            class="fixed inset-0 overflow-hidden z-[2000] bg-gray-200 transform transition ease-in-out duration-500 sm:duration-700 translate-x-full"
            aria-labelledby="slide-over-title"
            id="slide-over-title"
            role="dialog"
            aria-modal="true"
        ></div>
    );
}
